import KTX_MAP_ALL:*;
import KTX_MAP_GOOGLE:*;
import KTX_MAP_MAPQUEST:*;
import KTX_MAP_OTHER:*;

Global string &ktxGblSqlStmt, &ktxGblWhere;

Local SQL &ktxSqlStmt;
Local string &ktxFileName, &strQryString, &strUrlString;

Function ktxCallAjaxIscript()

   Local boolean &bReturn;

   SQLExec("SELECT KTX_ISP_NAME FROM PS_KTX_TBL_INSTALL", &ktxIspName);
   SQLExec("SELECT PRCSNAME, KTX_RPT_NEW_WINDOW, RECNAME, FIELDNAME FROM PS_KTX_TBL_REPORT WHERE PRCSTYPE = 'AJAX' AND PNLGRPNAME = :1", %Component, &ktxPrcsName, &ktxRptNewWindow, &ktxRecName, &ktxFieldName);

   If RTrim(&ktxRecName, " ") = "" Then
      &ktxSqlStmt = CreateSQL(&ktxGblSqlStmt);
   Else
      &ktxSqlStmt = CreateSQL("SELECT 'X' FROM PS_INSTALLATION WHERE 1=2");
   End-If;

   &clsFile = create KTX_MAP_ALL:XML();
   &ktxFileName = &clsFile.FileName();
   &ktxFile = &clsFile.CreateFile(&ktxFileName);
   If &ktxFile.IsOpen Then
      Evaluate &ktxIspName
      When = "GOOG"
         &clsMapXml = create KTX_MAP_GOOGLE:XML();
         &ktxPrefix = Left(&ktxPrcsName, 4);
         Evaluate &ktxPrefix
            /* QRYA - For queries with address fields only */
         When = "QRYA"
            &clsMapXml.WriteQueryAddr(&ktxFile, &ktxPrcsName, &ktxSqlStmt);
            Break;
            /* QRYA - For queries that include geocode fields */
         When = "QRYG"
         When = "QRY0"
            &clsMapXml.WriteQuery(&ktxFile, &ktxSqlStmt);
            Break;
            /* QRYA - For non-queries that include Record and Field Name */
         When-Other
            &bReturn = &clsMapXml.WriteInt(&ktxFile);
            Break;
         End-Evaluate;
         REM &clsXmlWrite.DetermineOutputFormat(&ktxIspName, &ktxFile, &ktxPrcsName, &ktxRecName, &ktxFieldName, &ktxSqlStmt);
         Break;
      When = "QUST"
         &clsMapXml = create KTX_MAP_MAPQUEST:XML();
         &clsMapXml.Write(&ktxFile, &ktxPrcsName, &ktxRecName, &ktxFieldName, &ktxSqlStmt);
         Break;
      When = "MSFT"
      When = "YHOO"
         &clsMapXml = create KTX_MAP_OTHER:XML();
         &clsMapXml.Write(&ktxFile, &ktxPrcsName, &ktxRecName, &ktxFieldName, &ktxSqlStmt);
         Break;
      When-Other
         Break;
      End-Evaluate;
   Else
      /* file not open - do error processing */
   End-If;
   &ktxFile.Close();

   &nStart = Len(&ktxFileName) - 17;
   &ktxFileName = Substring(&ktxFileName, &nStart, 14);
   /* ktx TODO: pull and assign KeyString from installation table */
   REM &ktxFileName = Encrypt("", &ktxFileName);

   /* Build URL for IScript */
   &strQryString = "IScript_ktxAjax?fn=" | &ktxFileName | "&pn=" | &ktxPrcsName | "&component=" | %Component;
   &strUrlString = GenerateScriptContentURL(%Portal, %Node, Record.WEBLIB_KTX, Field.ISCRIPT2, "FieldFormula", &strQryString);
   ViewURL(&strUrlString, &ktxRptNewWindow);

End-Function;

DoSave();

&clsSql = create KTX_MAP_ALL:SQL();
&ktxGblWhere = "";
&ktxGblWhere = &clsSql.WhereBinds1(&ktxGblWhere, True, "EMPLID", "K0MKR001");

ktxCallAjaxIscript();

