Function ktx_xml_get();

   Local array of XmlNode &arrAddress1, &arrCity, &arrState, &arrPostal, &arrLngLat, &arrAddress;
   Local boolean &bReturn;
   Local number &i;
   Local XmlDoc &ktxXmlDoc;

   &clsGeoUrl = create KTX_GEO_GOOGLE:URL();

   &ktxAddress = Substitute((DERIVED_ADDRESS.ADDRESS1 | ", " | DERIVED_ADDRESS.CITY | ", " | DERIVED_ADDRESS.STATE | " " | DERIVED_ADDRESS.POSTAL), " ", "+");
   &ktxApiAction = &clsGeoUrl.Build(&ktxAddress);

   &ktxXmlDoc = CreateXmlDoc("");
   &bReturn = &ktxXmlDoc.ParseXmlFromURL("" | &ktxApiAction | "");
   If (&bReturn) Then
      &arrAddress1 = &ktxXmlDoc.GetElementsByTagName("ThoroughfareName");
      REM &arrCity = &ktxXmlDoc.GetElementsByTagName("");
      &arrState = &ktxXmlDoc.GetElementsByTagName("AdministrativeAreaName");
      &arrPostal = &ktxXmlDoc.GetElementsByTagName("PostalCodeNumber");
      &arrLngLat = &ktxXmlDoc.GetElementsByTagName("coordinates");
      &arrAddress = &ktxXmlDoc.GetElementsByTagName("address");

      If &arrLngLat.Len <> 0 Then
         For &i = 1 To &arrLngLat.Len
            DERIVED_ADDRESS.ADDRESS1 = &arrAddress1 [&i].NodeValue;
            DERIVED_ADDRESS.ADDRESS2 = &arrAddress [&i].NodeValue;
            DERIVED_ADDRESS.ADDRESS3 = &arrLngLat [&i].NodeValue;
            REM DERIVED_ADDRESS.CITY = &arrCity [&i].NodeValue;
            DERIVED_ADDRESS.STATE = &arrState [&i].NodeValue;
            DERIVED_ADDRESS.POSTAL = &arrPostal [&i].NodeValue;
         End-For;
      Else
         DERIVED_ADDRESS.ADDRESS3 = "Geocode Error";
      End-If;
   Else
      DERIVED_ADDRESS.ADDRESS3 = "Geocode Error";
   End-If;

End-Function;

