/* Functions called by IScripts below */
Function ktxGetParams(&ktxFileName, &ktxRptStyle, &ktxApiSource, &ktxUrlRptSource, &ktxPrcsName)

   &ktxFileName = %Request.GetParameter("FN");
   &ktxPrcsName = %Request.GetParameter("PN");
   &ktxComponent = %Request.GetParameter("COMPONENT");

   /* ktx TODO: pull and assign KeyString from installation table */
   REM &ktxFileName = %UserId | Decrypt("", &ktxFileName) | ".xml";
   &ktxFileName = %UserId | &ktxFileName | ".xml";

   SQLExec("SELECT KTX_RPT_SIZE FROM PS_KTX_TBL_REPORT WHERE PRCSTYPE = 'AJAX' AND PRCSNAME = :1 AND PNLGRPNAME = :2", &ktxPrcsName, &ktxComponent, &ktxRptSize);
   SQLExec("SELECT KTX_ISP_NAME, KTX_URL_RPT_SOURCE FROM PS_KTX_TBL_INSTALL", &ktxIspName, &ktxUrlRptSource);

   Local KTX_MAP_ALL:URL &clsMapUrl;
   &clsMapUrl = create KTX_MAP_ALL:URL();
   &ktxApiSource = &clsMapUrl.Build(&ktxIspName);

   Evaluate &ktxRptSize
   When = "S"
      &ktxRptStyle = "position:relative; width:200px; height:150px";
   When = "M"
      &ktxRptStyle = "position:relative; width:400px; height:300px";
   When = "L"
      &ktxRptStyle = "position:relative; width:800px; height:600px";
   When-Other
      &ktxRptStyle = "position:relative; width:400px; height:300px";
   End-Evaluate;

End-Function;


Function IScript_ktxAjax()

   ktxGetParams(&ktxFileName, &ktxRptStyle, &ktxApiSource, &ktxUrlRptSource, &ktxPrcsName);

   &ktxRptSource = Lower(&ktxUrlRptSource | Left(&ktxIspName, 1) | "/" | &ktxPrcsName | ".js");

   %Response.WriteLine("<html>");
   %Response.WriteLine(GetHTMLText(HTML.KTX_HEAD01, &ktxApiSource, &ktxRptSource));

   Evaluate Left(Upper(&ktxIspName), 1)
   When = "G"
   When = "M"
      /* BODY binds are in different order */
      %Response.WriteLine(GetHTMLText(HTML.KTX_MBODY01, &ktxFileName, &ktxRptStyle));
      Break;
   When = "Q"
   When = "Y"
      %Response.WriteLine(GetHTMLText(HTML.KTX_YBODY01, &ktxRptStyle, &ktxFileName));
      Break;
   When-Other
      Break;
   End-Evaluate;

   %Response.WriteLine("</html>");

End-Function;

