Function fUseMapQuest()

   Local KTX_GEO_ALL:Substitute &clsGeoSub;
   Local KTX_GEO_MAPQUEST:URL &clsGeoUrl;
   Local KTX_GEO_MAPQUEST:XML &clsGeoXml;

   &clsGeoSub = create KTX_GEO_ALL:Substitute();
   &clsGeoUrl = create KTX_GEO_MAPQUEST:URL();
   &clsGeoXml = create KTX_GEO_MAPQUEST:XML();

   &outAddress1 = &clsGeoSub.Stuff("%20", &strAddress1);
   &outCity = &clsGeoSub.Stuff("%20", &strCity);
   &outState = &clsGeoSub.Stuff("%20", &strState);
   &outPostal = &clsGeoSub.Stuff("%20", &strPostal);
   &outCountry = &clsGeoSub.Stuff("%20", &strCountry);

   try
      &ktxUrlBuild = &clsGeoUrl.Build(&outAddress1, &outCity, &outState, &outPostal, &outCountry);
      &fileName.WriteLine("&ktxUrlBuild : " | &ktxUrlBuild);
      &arrXmlNode = &clsGeoXml.Read(&ktxUrlBuild);
      If &arrXmlNode [1] < "1900" Then
         &sqlGeoAddressUpdate = GetSQL(SQL.KTX_GEO_ADDRESS_UPDATE, " ", &arrXmlNode [2], &arrXmlNode [3], &arrXmlNode [4], &arrXmlNode [5], &arrXmlNode [1], 0, &arrXmlNode [6], &arrXmlNode [7], %Datetime, %OperatorId, &strCountry, &strAddress1, &strCity, &strState, &strPostal);
      Else
         fBadData();
      End-If;
   catch Exception &cl
      fExceptions("MapQuest");
   end-try;

End-Function;


