Function funcWriteLine(&inFile, &inSqlStmt)
   &inSqlStmt = Substitute(&inSqlStmt, (Char(13) | Char(10)), " ");
   &sqlSource = CreateSQL(&inSqlStmt);
   &sqlSource.Open(&inSqlStmt);

   &inFile.WriteLine("<?xml version='1.0'?>");
   &inFile.WriteLine("<Start>");
   &inFile.WriteLine("  <Addresses type=""Employees"">");
   While &sqlSource.Fetch(&strEmplid, &strAddress1, &strCity, &strState, &strPostal, &nbrLat, &nbrLng)
      If (&nbrLat <> 0 And
            &nbrLng <> 0) Then
         If RTrim(&strAddress1, " ") = "" Then
            &strAddress1 = "KTX";
         End-If;
         If RTrim(&strCity, " ") = "" Then
            &strCity = "KTX";
         End-If;
         If RTrim(&strState, " ") = "" Then
            &strState = "KTX";
         End-If;
         If RTrim(&strPostal, " ") = "" Then
            &strPostal = "KTX";
         End-If;
         &inFile.WriteLine("    <Address>");
         &inFile.WriteLine("      <Emplid>" | &strEmplid | "</Emplid>");
         &inFile.WriteLine("      <Address1>" | &strAddress1 | "</Address1>");
         &inFile.WriteLine("      <City>" | &strCity | "</City>");
         &inFile.WriteLine("      <State>" | &strState | "</State>");
         &inFile.WriteLine("      <Postal>" | &strPostal | "</Postal>");
         &inFile.WriteLine("      <Ktx_Lat>" | &nbrLat | "</Ktx_Lat>");
         &inFile.WriteLine("      <Ktx_Lng>" | &nbrLng | "</Ktx_Lng>");
         &inFile.WriteLine("    </Address>");
      End-If;
   End-While;
   &inFile.WriteLine("  </Addresses>");
   &inFile.WriteLine("</Start>");

   &sqlSource.Close();
End-Function;

Function funcCreateFile(&sFileName)
   &clsFile = create KTX_MAP_ALL:XML();
   &sFileName = &clsFile.FileName();
   &ktxFile = &clsFile.CreateFile(&sFileName);
   If &ktxFile.IsOpen Then
      funcGetSQL(&sSql);
      funcWriteLine(&ktxFile, &sSql);
   End-If;
   &ktxFile.Close();
End-Function;


