class Substitute
   /* Public methods */
   method Stuff(&inBlanks As string, &inString As string) Returns string;

end-class;

method Stuff
   /+ &inBlanks as String, +/
   /+ &inString as String +/
   /+ Returns String +/

   Local string &outString;

   &outString = &inString;

   REM &outString = Substitute(&outString, "", "A");
   REM &outString = Substitute(&outString, "", "A");
   REM &outString = Substitute(&outString, "", "B");
   REM &outString = Substitute(&outString, "", "C");
   REM &outString = Substitute(&outString, "", "E");
   REM &outString = Substitute(&outString, "", "E");
   REM &outString = Substitute(&outString, "", "E");
   REM &outString = Substitute(&outString, "", "I");
   REM &outString = Substitute(&outString, "", "O");
   REM &outString = Substitute(&outString, "", "O");
   REM &outString = Substitute(&outString, "", "U");
   &outString = Substitute(&outString, "#", "");
   &outString = Substitute(&outString, ".", "");
   &outString = Substitute(&outString, "&", "AND");
   &outString = Substitute(&outString, "", "");

   &outString = Substitute(&outString, " ", &inBlanks);

   Return &outString;

end-method;

