class URL
   /* Public methods */
   method Build(&inBind1 As string) Returns string;

private
   instance string &outUrl;

end-class;

method Build
   /+ &inBind1 as String +/
   /+ Returns String +/

   Local SQL &sqlUrl, &sqlQry;
   Local string &strUrl, &strQuery, &strParamName, &strParamValue;

   &sqlUrl = GetSQL(SQL.KTX_TBL_ISP_URL_SELECT, "GEO", "GOOG", %AsOfDate);
   While &sqlUrl.Fetch(&strUrl)
      Break;
   End-While;
   &sqlUrl.Close();

   &sqlQry = GetSQL(SQL.KTX_TBL_ISP_QRY_SELECT, "GEO", "GOOG", %AsOfDate);
   While &sqlQry.Fetch(&strParamName, &strParamValue)
      If &strQuery = "" Then
         &strQuery = &strParamName | "=" | &strParamValue;
      Else
         &strQuery = &strQuery | "&" | &strParamName | "=" | &strParamValue;
      End-If;
   End-While;
   &sqlQry.Close();

   &strQuery = Substitute(&strQuery, "%BIND(1)", &inBind1);

   &outUrl = &strUrl | "?" | &strQuery;

   Return &outUrl;

end-method;

