class XML
   /* Public methods */
   method Read(&inUrl As string) Returns array of any;

private
   instance array of any &outArray;

end-class;

method Read
   /+ &inUrl as String +/
   /+ Returns Array of Any +/

   Local array of XmlNode &arrNodeStatus, &arrNodeAddress1, &arrNodeCity, &arrNodeState, &arrNodePostal, &arrNodeLngLat;
   Local boolean &bIsValid;
   Local integer &intComma1, &intComma2, &intLength, &intStart;
   Local string &strStatus, &strAddress1, &strCity, &strState, &strPostal, &strLat, &strLng;
   Local XmlDoc &xmlDoc;

   &strStatus = "999";
   &strAddress1 = " ";
   &strCity = " ";
   &strState = " ";
   &strPostal = " ";
   &strLat = "0";
   &strLng = "0";

   &xmlDoc = CreateXmlDoc("");
   &bIsValid = &xmlDoc.ParseXmlFromURL("" | &inUrl | "");

   If &bIsValid Then
      &arrNodeStatus = &xmlDoc.GetElementsByTagName("code");
      &arrNodeAddress1 = &xmlDoc.GetElementsByTagName("ThoroughfareName");
      &arrNodeCity = &xmlDoc.GetElementsByTagName("LocalityName");
      &arrNodeState = &xmlDoc.GetElementsByTagName("AdministrativeAreaName");
      &arrNodePostal = &xmlDoc.GetElementsByTagName("PostalCodeNumber");
      &arrNodeLngLat = &xmlDoc.GetElementsByTagName("coordinates");

      If &arrNodeStatus.Len <> 0 Then
         &strStatus = &arrNodeStatus [&arrNodeStatus.Len].NodeValue;
      End-If;

      If &arrNodeAddress1.Len <> 0 Then
         &strAddress1 = &arrNodeAddress1 [&arrNodeAddress1.Len].NodeValue;
      End-If;

      If &arrNodeCity.Len <> 0 Then
         &strCity = &arrNodeCity [&arrNodeCity.Len].NodeValue;
         &strCity = Substring(&strCity, 1, 30);
      End-If;

      If &arrNodeState.Len <> 0 Then
         &strState = &arrNodeState [&arrNodeState.Len].NodeValue;
         If Len(&strState) > 6 Then
            &strState = " ";
         End-If;
      End-If;

      If &arrNodePostal.Len <> 0 Then
         &strPostal = &arrNodePostal [&arrNodePostal.Len].NodeValue;
      End-If;

      If &arrNodeLngLat.Len <> 0 Then
         &intComma1 = Find(",", &arrNodeLngLat [&arrNodeLngLat.Len].NodeValue);
         &intLength = &intComma1 - 1;
         &strLng = Left(&arrNodeLngLat [&arrNodeLngLat.Len].NodeValue, &intLength);

         &intStart = &intComma1 + 1;
         &intComma2 = Find(",", &arrNodeLngLat [&arrNodeLngLat.Len].NodeValue, &intStart);
         &intLength = &intComma2 - &intStart;
         &strLat = Substring(&arrNodeLngLat [&arrNodeLngLat.Len].NodeValue, &intStart, &intLength);
      End-If;

   Else
      /* Geocode Error */
   End-If;

   &outArray = CreateArray();
   &outArray.Push(Upper(&strStatus));
   &outArray.Push(Upper(&strAddress1));
   &outArray.Push(Upper(&strCity));
   &outArray.Push(Upper(&strState));
   &outArray.Push(Upper(&strPostal));
   &outArray.Push(&strLat);
   &outArray.Push(&strLng);

   Return &outArray;

end-method;

