         End-If;
      End-If;

      If &arrNodePostal.Len <> 0 Then
         &strPostal = &arrNodePostal [&arrNodePostal.Len].NodeValue;
      End-If;

      If &arrNodeLat.Len <> 0 Then
         &strLat = &arrNodeLat [&arrNodeLat.Len].NodeValue;
      End-If;

      If &arrNodeLng.Len <> 0 Then
         &strLng = &arrNodeLng [&arrNodeLng.Len].NodeValue;
      End-If;
   Else
      /* Geocode Error */
   End-If;

   &outArray = CreateArray();
   &outArray.Push(Upper(&strStatus));
   &outArray.Push(Upper(&strAddress1));
   &outArray.Push(Upper(&strCity));
   &outArray.Push(Upper(&strState));
   &outArray.Push(Upper(&strPostal));
