class SQL
   /* Public methods */
   method WhereBinds1(&inWhere As string, &inType1 As boolean, &inName1 As string, &inValue1 As string) Returns string;
   method WhereBinds2(&inWhere As string, &inType1 As boolean, &inName1 As string, &inValue1 As string, &inType2 As boolean, &inName2 As string, &inValue2 As string) Returns string;

end-class;

method WhereBinds1
   /+ &inWhere as String, +/
   /+ &inType1 as Boolean, +/
   /+ &inName1 as String, +/
   /+ &inValue1 as String +/
   /+ Returns String +/

   Local number &i;

   If (&inType1) Then
      &inValue1 = "'" | &inValue1 | "'";
   End-If;

   If &inWhere = "" Then
      /* Think this is a bug */
      &inWhere = " 1=1 and (" | &inName1 | "=" | &inValue1 | ")";
   Else
      &inWhere = &inWhere | " or (" | &inName1 | "=" | &inValue1 | ")";
   End-If;

   Return &inWhere;

end-method;

method WhereBinds2
   /+ &inWhere as String, +/
   /+ &inType1 as Boolean, +/
   /+ &inName1 as String, +/
   /+ &inValue1 as String, +/
   /+ &inType2 as Boolean, +/
   /+ &inName2 as String, +/
   /+ &inValue2 as String +/
   /+ Returns String +/

   Local number &i;

   If (&inType1) Then
      &inValue1 = "'" | &inValue1 | "'";
   End-If;

   If (&inType2) Then
      &inValue2 = "'" | &inValue2 | "'";
   End-If;

   If &inWhere = "" Then
      /* Think this is a bug */
      &inWhere = " 1=1 and (" | &inName1 | "=" | &inValue1 | " and " | &inName2 | "=" | &inValue2 | ")";
   Else
      &inWhere = &inWhere | " or (" | &inName1 | "=" | &inValue1 | " and " | &inName2 | "=" | &inValue2 | ")";
   End-If;

   Return &inWhere;

end-method;

