method CenterLatLng
   /+ &inLatLng as Array of Number +/
   /+ Returns Array of Number +/

   Local array of number &outLatLng;
   Local number &inLat, &minLat, &maxLat, &ctrLat;
   Local number &inLng, &minLng, &maxLng, &ctrLng;

   &inLat = &inLatLng [1];
   &inLng = &inLatLng [2];
   &minLat = &inLatLng [3];
   &maxLat = &inLatLng [4];
   &minLng = &inLatLng [5];
   &maxLng = &inLatLng [6];
   &ctrLat = &inLatLng [7];
   &ctrLng = &inLatLng [8];

   If &minLat = 0 And
         &maxLat = 0 And
         &minLng = 0 And
         &maxLng = 0 Then
      &minLat = &inLat;
      &maxLat = &inLat;
      &minLng = &inLng;
      &maxLng = &inLng;
   Else
      If &inLat < &minLat Then
         &minLat = &inLat;
      End-If;
      If &inLat > &maxLat Then
         &maxLat = &inLat;
      End-If;
      If &inLng < &minLng Then
         &minLng = &inLng;
      End-If;
      If &inLng > &maxLng Then
         &maxLng = &inLng;
      End-If;
   End-If;

   &ctrLat = (&maxLat + &minLat) / 2;
   &ctrLng = (&maxLng + &minLng) / 2;

   &outLatLng = CreateArrayRept(0, 8);
   &outLatLng [1] = &inLat;
   &outLatLng [2] = &inLng;
   &outLatLng [3] = &minLat;
   &outLatLng [4] = &maxLat;
   &outLatLng [5] = &minLng;
   &outLatLng [6] = &maxLng;
   &outLatLng [7] = &ctrLat;
   &outLatLng [8] = &ctrLng;

   Return &outLatLng;

end-method;


method CreateFile
   /+ &inFileName as String +/
   /+ Returns File +/

   Local File &outFile;
   Local string &strFilePath;

   SQLExec("SELECT KTX_FILE_PATH FROM PS_KTX_TBL_INSTALL", &strFilePath);
   &outFile = GetFile(&strFilePath | &inFileName, "W", %FilePath_Absolute);

   Return &outFile;

end-method;


method FileName
   /+ Returns String +/

   Local string &outFileName;

   &outFileName = %UserId | %Datetime;
   /* ktx TODO: redo next line */
   &outFileName = Substitute(&outFileName, "000000", "");
   &outFileName = Substitute(&outFileName, "-", "");
   &outFileName = Substitute(&outFileName, ".", "");
   &outFileName = &outFileName | ".xml";

   Return &outFileName;

end-method;

