class XML
   /* Public methods */
   method WriteQuery(&inFile As File, &inSql As SQL) Returns boolean;
   method WriteInt(&inFile As File) Returns boolean;
   method WriteOverlays(&inFile As File, &inPrcsName As string, &inRecName As string, &inFieldName As string) Returns boolean;
   method WriteAddress(&inFile As File, &inEmplid As string, &inAddress1 As string, &inCity As string, &inState As string, &inPostal As string, &inLat As number, &inLng As number) Returns boolean;

end-class;

Global string &ktxGblWhere, &ktxGblWhereJoid;

method WriteQuery
   /+ &inFile as File, +/
   /+ &inSql as SQL +/
   /+ Returns Boolean +/

   Local boolean &bAddress;
   Local number &nbrLat, &nbrLng;
   Local string &strEmplid, &strAddress1, &strCity, &strState, &strPostal;

   &inFile.WriteLine("<?xml version='1.0'?>");
   &inFile.WriteLine("<Start>");
   &inFile.WriteLine("  <Addresses type=""Employees"">");
   While &inSql.Fetch(&strEmplid, &strAddress1, &strCity, &strState, &strPostal, &nbrLat, &nbrLng)
      If (&nbrLat <> 0 And
            &nbrLng <> 0) Then
         &bAddress = %This.WriteAddress(&inFile, &strEmplid, &strAddress1, &strCity, &strState, &strPostal, &nbrLat, &nbrLng);
      End-If;
   End-While;
   &inFile.WriteLine("  </Addresses>");
   &inFile.WriteLine("</Start>");
   &inSql.Close();

   Return True;

end-method;

method WriteInt
   /+ &inFile as File +/
   /+ Returns Boolean +/

   Local array of number &arrLatLng;
   Local boolean &bAddress, &bLocations;
   Local number &nbrLat, &nbrLng;
   Local Record &recSource;
   Local SQL &sqlOverlay, &sqlSource;
   Local string &strPrcsName, &strRecName, &strFieldName;
   Local string &strOverlayRecName, &strSqlStmt;
   Local string &strEmplid;

   Local KTX_MAP_ALL:XML &clsLatLng;

   &clsLatLng = create KTX_MAP_ALL:XML();
   &arrLatLng = CreateArrayRept(0, 8);

   If RTrim(&ktxGblWhere, " ") = "" Then
      &ktxGblWhere = "1=2";
   End-If;

   SQLExec("SELECT PRCSNAME, RECNAME, FIELDNAME FROM PS_KTX_TBL_REPORT WHERE PRCSTYPE = 'AJAX' AND PNLGRPNAME = :1", %Component, &strPrcsName, &strRecName, &strFieldName);

   &recSource = CreateRecord(@("Record." | &strRecName));
   &strSqlStmt = "%Selectall(:1) where " | &ktxGblWhere;
   &sqlSource = CreateSQL(&strSqlStmt, &recSource);
   &sqlSource.Open(&strSqlStmt, &recSource);
   &inFile.WriteLine("<?xml version='1.0'?>");
   &inFile.WriteLine("<Start>");

   &sqlOverlay = GetSQL(SQL.KTX_TBL_RPT_OVL_SELECT, &strPrcsName, %Component);
   While &sqlOverlay.Fetch(&strOverlayRecName)
      /* ktx TODO: Put LOCATION in table */
      &bLocations = %This.WriteOverlays(&inFile, &strPrcsName, &strOverlayRecName, "LOCATION");
   End-While;
   &sqlOverlay.Close();

   &inFile.WriteLine("  <Addresses type=""Employees"">");
   While &sqlSource.Fetch(&recSource)
      &nbrLat = &recSource.KTX_GEO_LAT.Value;
      &nbrLng = &recSource.KTX_GEO_LNG.Value;
      If (&nbrLat <> 0 And
            &nbrLng <> 0) Then
         &strEmplid = &recSource.GetField(@("Field." | &strFieldName)).Value;
         &bAddress = %This.WriteAddress(&inFile, &strEmplid, &recSource.ADDRESS1.Value, &recSource.CITY.Value, &recSource.STATE.Value, &recSource.POSTAL.Value, &nbrLat, &nbrLng);
         &arrLatLng [1] = &nbrLat;
         &arrLatLng [2] = &nbrLng;
         &arrLatLng = &clsLatLng.CenterLatLng(&arrLatLng);
      End-If;
   End-While;
   &inFile.WriteLine("  </Addresses>");
   &inFile.WriteLine("</Start>");
   &sqlSource.Close();

   /* Not sure if the next line is needed */
   &ktxGblWhere = "";

   Return True;

end-method;

method WriteOverlays
   /+ &inFile as File, +/
   /+ &inPrcsName as String, +/
   /+ &inRecName as String, +/
   /+ &inFieldName as String +/
   /+ Returns Boolean +/

   Local boolean &bAddress;
   Local Record &recSource;
   Local SQL &sqlSource;
   Local string &strSqlStmt;
   Local string &strEmplid;

   &recSource = CreateRecord(@("Record." | &inRecName));
   &strSqlStmt = "%Selectall(:1) where " | &ktxGblWhereJoid;
   &sqlSource = CreateSQL(&strSqlStmt, &recSource);
   &sqlSource.Open(&strSqlStmt, &recSource);
   &inFile.WriteLine("  <Addresses type=""Locations"">");
   While &sqlSource.Fetch(&recSource)
      If (&recSource.KTX_GEO_LAT.Value <> 0 And
            &recSource.KTX_GEO_LNG.Value <> 0) Then
         &strEmplid = &recSource.GetField(@("Field." | &inFieldName)).Value;
         &bAddress = %This.WriteAddress(&inFile, &strEmplid, &recSource.ADDRESS1.Value, &recSource.CITY.Value, &recSource.STATE.Value, &recSource.POSTAL.Value, &recSource.KTX_GEO_LAT.Value, &recSource.KTX_GEO_LNG.Value);
      End-If;
   End-While;
   &inFile.WriteLine("  </Addresses>");
   &sqlSource.Close();

   Return True;

end-method;

method WriteAddress
   /+ &inFile as File, +/
   /+ &inEmplid as String, +/
   /+ &inAddress1 as String, +/
   /+ &inCity as String, +/
   /+ &inState as String, +/
   /+ &inPostal as String, +/
   /+ &inLat as Number, +/
   /+ &inLng as Number +/
   /+ Returns Boolean +/

   If RTrim(&inAddress1, " ") = "" Then
      &inAddress1 = "KTX";
   End-If;
   If RTrim(&inCity, " ") = "" Then
      &inCity = "KTX";
   End-If;
   If RTrim(&inState, " ") = "" Then
      &inState = "KTX";
   End-If;
   If RTrim(&inPostal, " ") = "" Then
      &inPostal = "KTX";
   End-If;

   &inFile.WriteLine("    <Address>");
   &inFile.WriteLine("      <Emplid>" | &inEmplid | "</Emplid>");
   &inFile.WriteLine("      <Address1>" | &inAddress1 | "</Address1>");
   &inFile.WriteLine("      <City>" | &inCity | "</City>");
   &inFile.WriteLine("      <State>" | &inState | "</State>");
   &inFile.WriteLine("      <Postal>" | &inPostal | "</Postal>");
   &inFile.WriteLine("      <Ktx_Lat>" | &inLat | "</Ktx_Lat>");
   &inFile.WriteLine("      <Ktx_Lng>" | &inLng | "</Ktx_Lng>");
   &inFile.WriteLine("    </Address>");

   Return True;

end-method;

