   /+ &inFile as File, +/
   /+ &inPrcsName as String, +/
   /+ &inRecName as String, +/
   /+ &inFieldName as String, +/
   /+ &inSqlStmt as String +/
   /+ Returns Boolean +/

   Local Record &recSource;
   Local SQL &sqlSource;
   Local string &strSqlStmt;

   If RTrim(&ktxGblWhere, " ") = "" Then
      &ktxGblWhere = "1=2";
   End-If;

   &recSource = CreateRecord(@("Record." | &inRecName));
   &strSqlStmt = "%Selectall(:1) where " | &ktxGblWhere;
   &sqlSource = CreateSQL(&strSqlStmt, &recSource);
   &sqlSource.Open(&strSqlStmt, &recSource);

   &inFile.WriteLine("<?xml version='1.0'?>");
   /* ktx TODO: Get count */
   &inFile.WriteLine("<locationCollection count='99'>");
   While &sqlSource.Fetch(&recSource)
      If (&recSource.KTX_GEO_LAT.Value <> 0 And
            &recSource.KTX_GEO_LNG.Value <> 0) Then
         &inFile.WriteLine("<location>");
         &inFile.WriteLine("  <name>" | &recSource.GetField(@("Field." | &inFieldName)).Value | "</name>");
         &inFile.WriteLine("  <address>" | &recSource.ADDRESS1.Value | "</address>");
         &inFile.WriteLine("  <city>" | &recSource.CITY.Value | "</city>");
         &inFile.WriteLine("  <stateProvince>" | &recSource.STATE.Value | "</stateProvince>");
         &inFile.WriteLine("  <postalCode>" | &recSource.POSTAL.Value | "</postalCode>");
         &inFile.WriteLine("  <latitude>" | &recSource.KTX_GEO_LAT.Value | "</latitude>");
         &inFile.WriteLine("  <longitude>" | &recSource.KTX_GEO_LNG.Value | "</longitude>");
         &inFile.WriteLine("  <iconId>11</iconId>");
         &inFile.WriteLine("</location>");
      End-If;
   End-While;
   &inFile.WriteLine("</locationCollection>");

   &ktxGblWhere = "";
   &sqlSource.Close();

   Return True;

end-method;

